  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className = "payslipwrapper">
      <h3>Payslip </h3>
      <h4>Employee Name </h4>
      <Table striped bordered hover>

  <tbody>
    <tr>
      <td>Pay Date</td>
      <td>Mark</td>
    </tr>
    <tr>
      <td>Pay Frequency</td>
      <td>Jacob</td>
    </tr>
    <tr>
      <td>3</td>
      <td colSpan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</Table>

</div>


    );
  }
}

export default PaySlipDetails;
